function Entity(){this.x=0,this.y=0,this.width=0,this.height=0,this.xVelocity=0,this.yVelocity=0}Entity.prototype.update=function(){this.x+=this.xVelocity,this.y+=this.yVelocity},Entity.prototype.draw=function(t){t.fillStyle="#fff",t.fillRect(this.x,this.y,this.width,this.height)},Entity.prototype.intersect=function(t){return this.y+this.height>t.y&&this.y<t.y+t.height&&this.x+this.width>t.x&&this.x<t.x+t.width};